(71, 126, 5, NULL, '<p>\r\n<style type="text/css">h1 { margin-left: 0.6in; text-indent: -0.6in; margin-top: 0in; margin-bottom: 0.04in; direction: ltr; color: rgb(0, 0, 0); text-align: justify; }h1.western { font-family: "Liberation Serif",serif; font-size: 12pt; font-weight: normal; }h1.cjk { font-size: 10pt; font-weight: normal; }h1.ctl { font-size: 12pt; font-weight: normal; }p { margin-bottom: 0in; direction: ltr; color: rgb(0, 0, 0); text-align: justify; }p.western { font-size: 12pt; font-weight: bold; }p.cjk { font-size: 12pt; font-weight: bold; }p.ctl { }a:link\r\n</style>\r\n<strong><font face="Garamond, serif"><font size="3" style="font-size: 13pt">Clinical History:</font></font></strong></p>\r\n\r\n<p class="western" lang="de-CH" style="font-weight: normal; orphans: 0; widows: 0"><font size="3" style="font-size: 12pt"><font face="Garamond, serif"><font size="3" style="font-size: 13pt"><span lang="en-US"><b>Technique:</b></span></font></font><font face="Garamond, serif"><font size="3" style="font-size: 13pt"><span lang="en-US"> - </span></font></font></font>Unenhanced and enhanced {post---mls of IV contrast administration} multi-axial CT sections of the head were obtained from the base of skull to the bony calvarium using a 16-slice multi-detector CT.</p>\r\n\r\n<p class="western" style="orphans: 0; widows: 0"><font face="Garamond, serif"><font size="3" style="font-size: 13pt"><b>Findings:</b></font></font></p>\r\n\r\n<p>The cerebral grey and white matter appears normal. No focal lesion is seen in the cerebral parenchyma.</p>\r\n\r\n<p>The basal ganglia and thalami are normal.</p>\r\n\r\n<p>The posterior fossa structures including the brain stem and cerebellum do not show any abnormality.</p>\r\n\r\n<p>The ventricular system, cisternal &amp; sulcal spaces are normal.</p>\r\n\r\n<p>No abnormal leptomeningeal or parenchymal enhancement is seen post-contrast administration.</p>\r\n\r\n<p>The base of skull and bony calvarium appear normal.</p>\r\n\r\n<p>The visualized portions of the para-nasal sinuses and orbits are normal.</p>\r\n\r\n<p class="western" lang="de-CH" style="font-weight: normal; orphans: 0; widows: 0"><font face="Garamond, serif"><font size="3" style="font-size: 13pt"><b>IMPRESSION:</b></font></font></p>\r\n\r\n<p class="western" lang="de-CH" style="font-weight: normal; orphans: 0; widows: 0"><strong>Essentially normal CT Head examination. </strong><strong>No significant intracranial abnormality is seen.</strong></p>\r\n\r\n<p align="left"><font face="Garamond, serif"><font size="3" style="font-size: 12pt"><b>Dr Ben Carson</b></font></font></p>\r\n\r\n<p align="left"><font face="Garamond, serif"><font size="3" style="font-size: 12pt"><b>Consultant radiologist</b></font></font></p>\r\n\r\n<p class="western" lang="de-CH" style="orphans: 0; widows: 0">&nbsp;</p>\r\n\r\n<p class="western" lang="de-CH" style="font-weight: normal; orphans: 0; widows: 0">&nbsp;</p>\r\n\r\n<p class="western" lang="de-CH" style="font-weight: normal; orphans: 0; widows: 0">&nbsp;</p>\r\n', NULL, NULL, 0, '2017-05-23 16:56:06', '2017-05-23 16:56:06'),
